#主动参数设置
alter table zw_m_adas_alarm_param_setting add column initiative_picture_enable int(11) COMMENT '主动拍照使能0：关闭 1：打开';
alter table zw_m_adas_alarm_param_setting add column driver_change_enable int(11) COMMENT '驾驶员更换事件使能0：关闭 1：打开';
alter table zw_m_adas_alarm_param_setting add column offline_face_compare_enable int(11) COMMENT '离线人脸对比使能0：关闭 1：打开';
alter table zw_m_adas_alarm_param_setting add column dsm_compare_success_percent int(11) COMMENT 'DSM人脸比对成功阀值(1%)';
alter table zw_m_adas_alarm_param_setting add column phone_compare_success_percent int(11) COMMENT '手机人脸比对成功阀值(1%)';
alter table zw_m_adas_alarm_param_setting add column voice_broadcast_comparison_enable int(11) COMMENT '语音播报比对结果使能0：关闭 1：打开';
#补充漏掉的字段信息
